import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import App from './App';

const CRoutes: React.FC = () => {
  return (
    <Router>        
      <Routes>
        <Route path="/about">
        </Route>
        <Route path="/contact">
        </Route>
        <Route path="/" element={<App/>}></Route>
      </Routes>
    </Router>
  );
};

export default Routes;
